import React from "react"

export class Header extends React.Component{
    componentDidMount(){
        document.title = "Patryk Morawski 185IC B1 - Laboratorium 6"
    }
    render(){
        return(
            <header class='shadow'>
                <div class="row">
                    <div class="name">
                        <h1>SHOPPER</h1>
                        <h5>Sklep internetowy</h5> 
                    </div>
                </div>
            </header>
        );
    }
}

export class Strona extends React.Component{
    render(){
        return(
            <div class="w-75 mx-auto shadow">
                 <Oferta></Oferta>
            </div>
        );
    }
}


export class Oferta extends React.Component{
    render(){
        return(
            <div>
                <div class="row">
                    <div class="col-md-3">OBRAZEK</div>
                    <div class="col-md-9">Opis
                    </div>
                </div>
            </div>
        )
    }
}

function Opis(informacje){
    return(
        <span>informacje</span>
    );
}
